import "./Mainselect.css";
import data from "./Data3";
function Selitem(props) {
  return (
    <div className="class2">
      <div className="angle">
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[props.index + 1].picture}
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[props.index + 2].picture}
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[props.index + 3].picture}
          />
        </div>
      </div>
      <div className="mainitem"></div>
      <div className="descrp"></div>
    </div>
  );
}
export default Selitem;
